import React, { useEffect, useRef } from "react";
import { init } from "ityped";

const About = () => {
    const textRef = useRef();
    useEffect(() => {
        init(textRef.current, {
            showCursor: true,
            strings: ["Front-end Developer"],
        });
    }, []);

    return (
        <div>
            <h2>Hi I'm </h2>
            <h1>Nwaose Victor</h1>
            <h3>
                Freelance {""}
                <span ref={textRef}></span>
            </h3>
        </div>
    );
};

export default About;
